import { Canvas } from "lively.components/canvas.js";
import THREE from "https://dev.jspm.io/three";
const { Scene, SpotLight, MeshBasicMaterial, BackSide, ImageUtils, Color, MeshPhongMaterial, SphereGeometry, Mesh, DirectionalLight, AmbientLight, WebGLRenderer, PerspectiveCamera, TextureLoader, BoxGeometry, MeshNormalMaterial } = THREE;
import { easings } from "lively.morphic/index.js";

export default class WebGLCanvas extends Canvas {

  static get properties() {
    return {
      fps: {},
    }
  }

  get context() { 
    if (navigator.webdriver) {
      return this._canvas && this._canvas.getContext('2d');
    }
    return this._canvas && this._canvas.getContext(this.contextType, {
      preserveDrawingBuffer: true
    }); 
  }

  restoreContent(old_canvas, new_canvas) {
    let {contextType, preserveContents} = this;
    if (this.renderer && old_canvas && old_canvas !== new_canvas) {
      this.owner.context.drawImage(this.renderer.getContext().canvas, 0, 0)
      this.renderer = new WebGLRenderer({ context: this.context, antialiasing: true });
      this.renderer.setSize(this.width, this.height);
    }
  }

  onExtentChanged() {}

  relayout() {
    if (this.renderLoop) {
      setTimeout(() => this.owner.context.drawImage(this.renderer.getContext().canvas, 0, 0));
      this.renderer.setSize(this.width, this.height);
      this.camera.aspect = this.width / this.height;
      this.camera.updateProjectionMatrix();
    }
  }

  stopAnimation() {
    if (this.renderLoop)  {
      cancelAnimationFrame(this.renderLoop);
      this.renderer.dispose();
    }
  }

  //this.renderGlobe()

  renderGlobe() {
    this.stopAnimation();
    this.withContextDo(webglEl => {
    	var width  = this.width,
    		 height = this.height,

         textureDir = 'assets/globe-textures/';

    	// Earth params
    	var radius   = 0.5,
    		   segments = 32,
    		   rotation = 5.2;  

    	var scene = new Scene();

    	var camera = new PerspectiveCamera(45, width / height, 0.01, 1000);
    	camera.position.z = 1;
      camera.position.x = .4;
      camera.position.y = .25;
      this.camera = camera;

    	scene.add(new AmbientLight(0x333333));

    	var light = new SpotLight(0xffffff, 1, 200, Math.PI/2, 1);
    	light.position.set(1,1,0);
      light.castShadow = true;
      light.shadow.mapSize.width = 1024;  // default 512
      light.shadow.mapSize.height = 1024; // default 512
      light.shadow.camera.near = 10;       // default 0.5
      light.shadow.camera.far = 100;
      light.shadow.bias = 0.01
    	scene.add(light);

      var sphere = createSphere(radius, segments);
    	sphere.rotation.y = rotation; 
    	scene.add(sphere)

      var clouds = createClouds(radius, segments);
    	clouds.rotation.y = rotation;
    	scene.add(clouds)

    	var stars = createStars(90, 64);
    	scene.add(stars);

      this.renderer = new WebGLRenderer({ context: webglEl, antialias: true});
    	this.renderer.setSize(width, height);
    	const render = () => {
        if (!document.body.contains(this.renderer.getContext().canvas)) {
          if (this.removeScheduled) return;
          this.removeScheduled = setTimeout(() => {
            if (document.body.contains(this.renderer.getContext().canvas)) return;
            this.stopAnimation();
          }, 5000);
        }
    		sphere.rotation.y += 0.0005;
    		clouds.rotation.y += 0.0005;		
    		this.renderer.render(scene, camera);
    	};

      this.limitLoop(render);

      // this.animate({
      //   height: this.height,
      //   easing: easings.outQuint,
      //   customTween: (p) => {
      //     this.camera.position.z = 1 - (1 - p) * .9
      //     this.camera.position.x = .4 + (1 - p) * 0.2
      //     this.camera.position.y = .25 + (1 - p) * 0.2
      //   },
      //   duration: 15000
      // });

      this.camera.position.z = 1;
      this.camera.position.x = .4;
      this.camera.position.y = .25;

    	function createSphere(radius, segments) {
        let loader = new TextureLoader();
    		return new Mesh(
    			new SphereGeometry(radius, segments, segments),
    			new MeshPhongMaterial({
    				map:         loader.load(textureDir + '2_no_clouds_4k.jpg'),
    				bumpMap:     loader.load(textureDir + 'elev_bump_4k.jpg'),
    				bumpScale:   0.005,
        shininess: 5,
    				specularMap: loader.load(textureDir + 'water_4k.png'),
    				specular:    new Color('grey')								
    			})
    		);
    	}

    	function createClouds(radius, segments) {
        let loader = new TextureLoader();
    		return new Mesh(
    			new SphereGeometry(radius + 0.003, segments, segments),			
    			new MeshPhongMaterial({
    				map:         loader.load(textureDir + 'fair_clouds_4k.png'),
    				transparent: true
    			})
    		);		
    	}

    	function createStars(radius, segments) {
        let loader = new TextureLoader();
    		return new Mesh(
    			new SphereGeometry(radius, segments, segments), 
    			new MeshBasicMaterial({
    				map:  loader.load(textureDir + '/galaxy_starfield.png'), 
    				side: BackSide
    			})
    		);
    	}
    });
  }

  limitLoop(fn, fps) {

    // Use var then = Date.now(); if you
    // don't care about targetting < IE9
    var then = new Date().getTime(), globe = this;

    // custom fps, otherwise fallback to 60
    var loop;

    return (loop = (time) => {

        globe.renderLoop = requestAnimationFrame(loop);

        // again, Date.now() if it's available
        var now = new Date().getTime();
        var delta = now - then;
        let interval = (1000 / (fps || this.fps));

        if (delta > interval) {
            // Update time
            // now - (delta % interval) is an improvement over just 
            // using then = now, which can end up lowering overall fps
            then = now - (delta % interval);

            // call the fn
            fn();
            globe.firstFrameRendered = true;
        }
    })(0);
};
}

ModuleProgress.index.js:
import { Morph, stringToEasing, easings } from "lively.morphic";
import { pt } from "lively.graphics/index.js";
import { num, Path, promise, fun } from "lively.lang/index.js";

export default class ModuleProgress extends Morph {
  static get properties () {
    return {
      stages: {
        serialize: false,
        after: ['submorphs'],
        initialize () {
          this.whenRendered().then(() => {
            this.reset();
          });
        }
      }
    };
  }

  fadeIntoBack () {
    this.animate({
      blur: 5
    });
  }

  relayout () {
    if (this.isComponent || !Path('owner.isWorld').get(this)) return;
    this.bottomCenter = $world.visibleBounds().center().subXY(0, 100);
  }

  reset () {
    const stageMorphs = this.getAllNamed(/stage/);
    this.blur = 0;
    this.stages = new Map(stageMorphs.map(stage => [stage, 'not loaded']));
    this.updateProgressVisualization();
    this.getAllNamed(/label/).map(m => {
      m._cachedTextBounds = null;
      m.fit();
    });
  }

  updateProgressBar () {
    if (!this._lastWidth) return;
    this.relayout();
    const pb = this.get('progress path');
    const p = stringToEasing(easings.inOutExpo)(num.clamp(Date.now() - this._timeStamp, 0, 1000) / 1000);
    const targetWidth = this._currentProgress;
    pb.width = num.interpolate(p, this._lastWidth, targetWidth);
  }

  async fastLoadTest () {
    this.reset();
    const mods = ['lively.lang', 'lively.ast', 'lively.source-transform', 'lively.classes', 'lively.vm', 'lively.modules', 'lively.user', 'lively.storage', 'lively.morphic'];
    for (const mod of mods) {
      this.finishPackage({ packageName: mod, loaded: true });
      await promise.delay(200);
    }
  }

  // this.finishPackage({ packageName: 'lively.classes', loaded: true });
  // this.reset()

  finishPackage ({
    packageName, frozen, loaded
  }) {
    const stageName = 'stage ' + packageName.replace('lively.', '');
    const stageMorph = this.get(stageName);
    if (frozen) this.stages.set(stageMorph, 'frozen');
    if (loaded) this.stages.set(stageMorph, 'loaded');
    fun.debounceNamed('update progress', 200, () => {
      this.updateProgressVisualization();
    })();
  }

  updateProgressVisualization () {
    const progressPath = this.getSubmorphNamed('progress path');
    const stages = this.getAllNamed(/stage/);

    let stop = stages[0];
    stages.forEach(stage => {
      const checkmark = stage.get('checkmark');
      const frozenIndicator = stage.get('frozen indicator');
      const icon = stage.get('icon');

      const state = this.stages.get(stage);
      if (state != 'not loaded') {
        stop = checkmark;
        if (state == 'loaded') {
          if (checkmark.visible) return;
          checkmark.animate({
            duration: 300,
            visible: true
          });
        }
        if (state == 'frozen') {
          if (frozenIndicator.visible) return;
          frozenIndicator.animate({
            duration: 300,
            visible: true
          });
        }
        icon.opacity = 1;
      } else {
        checkmark.visible = false;
        frozenIndicator.visible = false;
        icon.opacity = 0.2;
      }
    });

    const progress = this.localizePointFrom(pt(-20, 0), stop).x;
    const dist = Math.max(20, progress - progressPath.left);
    const currentWidth = progressPath.width;

    if (dist == 20) {
      progressPath.visible = false;
    } else {
      progressPath.visible = true;
    }

    this._lastWidth = progressPath.width;
    this._timeStamp = Date.now();
    this._currentProgress = dist;
  }
}

